import React from 'react';
import Icon from '../../static/vectors/logo.svg';

const Logo = () => (
  <a href='/'>
    <svg
      version='1.1'
      xmlns='http://www.w3.org/2000/svg'
      x='0px'
      y='0px'
      width='30px'
      height='30px'
      viewBox='0 0 100 100'>
      <Icon />
    </svg>
  </a>
);

export default Logo;
